import React, { Component } from 'react';
import {
    NavLink,
    withRouter
} from 'react-router-dom';
import dahlia from "../images/DahliaHeader.jpg"
import Logo from "../images/plant.svg"

class NavBar extends Component {

    componentDidMount() {
        this.props.getProfile()
    }

    logout = event => {
        this.props.onLogout(event)
        this.props.history.push('/')
    }

    render() {
        return (
            <div>
                <div id="header" >
                    <img src={dahlia} className="ui fluid image" />
                </div>
                <div className="ui borderless main menu">
                    <div className="ui text container">
                      <div className="item"><img className="svg" src={Logo}/></div>
                      <div className="item"><strong>Plant Pals</strong></div>
                      <a className="item"><NavLink to="/">My Plants</NavLink></a>
                      <div className="ui right floated item"><strong>{this.props ? "Hello" + this.props.user.username : null}</strong></div>
                      <a className="ui item" ><NavLink to="/login">Login</NavLink></a>
                      <a className="ui item" onClick={this.logout}><NavLink to="/login">Logout</NavLink></a>
                    </div>
                </div>
            </div>

        )
    }
}

export default withRouter(NavBar);
